import React, { useContext } from 'react'
import Search from './Search';
import { EmojiContext } from '../context/EmojiContext';



const EmojiList = () => {

  const {emoji} = useContext(EmojiContext);


  return (
    <div className='flex flex-col justify-center w-full pl-10 pr-10 m-2' >
        <Search/>
    
      {
          emoji.map((emo,id) =>(
            <div key={id}   className='flex  m-1 divide-y divide-slate-200 bg-slate-100'  >
              <p className='text-4xl' > {emo.symbol} </p>
              <p className='text-xl' > {emo.title} </p>
              
            </div>


          ) )


      }
      


    </div>
  )
}

export default EmojiList;
